class Classy:
    def __init__(self):
        pass

    def numIslands (self, grid) -> int:
        if not grid:
            return 0
        else:
            from collections import deque
            que = deque ()
            self.visited = []
            count = 0
            for i in range (len (grid)):
                for j in range (len (grid[0])):
                    if grid[i][j] == "1" and (i, j) not in self.visited:
                        que.append ([i, j])
                        count += 1
                        while que:
                            temp0,temp1 = que.popleft ()

                            if [temp0,temp1] not in self.visited:
                                self.visited.append ([temp0,temp1])
                                grid[temp0][temp1] = 0
                                if temp0 - 1 >= 0 and grid[temp0 - 1][j] == "1" and [temp0 - 1, temp1] not in self.visited:
                                    que.append ([temp0 - 1, temp1])
                                if temp0 + 1 < len (grid) and grid[temp0 + 1][temp1] == "1" and [temp0 + 1 , temp1] not in self.visited:
                                    que.append ([temp0 + 1, temp1])
                                if temp1 - 1 >= 0 and grid[temp0][temp1 - 1] == "1" and [temp0,temp1-1] not in self.visited:
                                    que.append ([temp0, temp1 - 1])
                                if temp1 + 1 < len (grid[0]) and grid[temp0][temp1 + 1] == "1" and [temp0, temp1+1 ] not in self.visited:
                                    que.append ([temp0, temp1 + 1])
            return count


